def findMax(arg):
  arr = str(arg).split(',')
  arr2 = []
  for i in arr:
    arr2.append(int(i))
  return max(arr2)

print(findMax(input()))

fields.python_code:
def findMax(arg):
  arr = str(arg).split(',')
  arr2 = []
  for i in arr:
    arr2.append(int(i))
  return max(arr2)

print(findMax(input()))

